import React from 'react';

function ListRendering() {
    const name = [2, 4, 6, 8, 10]


    return (<div>

        {

        <h2>{

            name.map (name => <h2>{name *2} </h2>)

            }</h2>


        } 

    </div>



    );
}

export default ListRendering;
